import './App.css';
import Profile from './Pages/Profile';
import {BrowserRouter , Switch, Route} from 'react-router-dom'


function App() {
  return (
    <>
     <BrowserRouter>
      <Switch>
      < Route exact path="/"  component={Profile}  / >
      < Route  path="/login"  component = { Login }  / >
      </Switch>
      </BrowserRouter>
    </>
  );
}

export default App;
